pragma solidity ^0.8.0;


//import "./MiMC_permutation.sol";
import "./MiMCpe7_generated.sol";


library MiMC_hash
{
    function ScalarField ()
        internal pure returns (uint256)
    {
        return 21888242871839275222246405745257275088548364400416034343698204186575808495617;
    }
    /* use r = 0;*/
    function MiMCpe7_mp( uint256[] memory alpha, uint256 r )
        internal pure returns (uint256)
    {
        uint256 localQ = 21888242871839275222246405745257275088548364400416034343698204186575808495617;

        for ( uint256 i = 0; i < alpha.length; i++ )
        {
            r = (r + alpha[i] + MiMCpe7_generated.MiMCpe7(alpha[i], r)) % localQ;
        }

        return r;
    }

    function MiMCpe7_md( uint256[] memory alpha, uint256 r )
        internal pure returns (uint256)
    {
        for ( uint256 i = 0; i < alpha.length; i++ )
        {
            r = MiMCpe7_generated.MiMCpe7(alpha[i], r);
        }

        return r;
    }
}
